INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 10046, 24001, 2, 2, 102301, "2030/12/17 14:59:59", "アヤネ", 401, 24, 0.0, "2020/07/31 12:00:00", 0.0);
