INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 10046, 24004, 2, 1, 192201, "2030/12/17 14:59:59", "アサヒ", 701, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 10046, 24005, 1, 2, 192201, "2030/12/17 14:59:59", "アサヒ", 702, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 10046, 24006, 2, 1, 192201, "2030/12/17 14:59:59", "アサヒ", 703, 24, 0.0, "2020/07/31 12:00:00", 0.0);
