INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 10046, 24008, 1, 2, 192301, "2030/12/17 14:59:59", "部員３", 802, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 10046, 24009, 2, 2, 192301, "2030/12/17 14:59:59", "部員３", 803, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("やった！", 0.0, 10046, 24010, 1, 1, 192501, "2030/12/17 14:59:59", "", 501, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("勝ったよ！", 0.0, 10046, 24011, 1, 1, 192501, "2030/12/17 14:59:59", "", 502, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("いい調子！", 0.0, 10046, 24012, 1, 1, 192501, "2030/12/17 14:59:59", "", 503, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 10046, 24013, 6, 2, 113501, "2030/12/17 14:59:59", "ミサト", 111, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 10046, 24014, 1, 2, 113501, "2030/12/17 14:59:59", "ミサト", 112, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 10046, 24015, 1, 2, 113501, "2030/12/17 14:59:59", "ミサト", 113, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 10046, 24016, 1, 2, 192401, "2030/12/17 14:59:59", "ダイチ", 611, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 10046, 24017, 1, 2, 192401, "2030/12/17 14:59:59", "ダイチ", 612, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 10046, 24018, 2, 2, 192401, "2030/12/17 14:59:59", "ダイチ", 613, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 10046, 24019, 2, 1, 113401, "2030/12/17 14:59:59", "ハツネ", 211, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 10046, 24020, 2, 1, 113401, "2030/12/17 14:59:59", "ハツネ", 212, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 10046, 24021, 1, 2, 113401, "2030/12/17 14:59:59", "ハツネ", 213, 24, 0.0, "2020/07/31 12:00:00", 0.0);
