INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 10046, 24023, 1, 2, 106501, "2030/12/17 14:59:59", "カヤ", 312, 24, 0.0, "2020/07/31 12:00:00", 0.0);
