INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 10046, 24027, 1, 3, 192301, "2030/12/17 14:59:59", "部員３", 821, 24, 0.0, "2020/07/31 12:00:00", 0.0);
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("いい勝負だったよ\nまたやろうね", 0.0, 10046, 24028, 1, 1, 192501, "2030/12/17 14:59:59", "", 521, 24, 0.0, "2020/07/31 12:00:00", 0.0);
