INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 10046, 24031, 2, 2, 113501, "2030/12/17 14:59:59", "ミサト", 103, 24, -360.0, "2020/07/31 12:00:00", 0.0);
